●さらに小さく、つかいやすく、小型ドリルドライバーが進化！<br>
●リチウムイオン電池搭載！作業量約25％アップ！！<br>
●軽量コンパクトで取り回しがラク<br>
●LEDや手締め機能などサポート機能が充実！！<br>
●高容量1.5Ah3.6Vリチウムイオン電池を新開発<br>
●電池切れお知らせランプ付<br>
●クラッチがはたらくと同時に電源をOFFするオートストップ機能付<br>
●クラッチ設定を保持する着脱式クラッチ固定カバー付属<br><br>

【付属品】<br>
・プラスチックケース<br>
・充電器<br>
・電池パック<br>
・磁石付ドライバービット♯2＋65mm1本<br><br>

【チャック】<br>
 ビットの着脱が簡単なワンタッチビットロック方式（段付までの寸法が13mm）<br><br>

【最大締付トルク】<br>
・高速 1.5N・m（15kgf・cm）<br> 
・低速 4.4N・m（45kgf・cm） <br><br>

【回転数】<br>
・高速 600回転/分<br> 
・低速 200回転/分 <br><br>

